import classes from "./Header.module.css"

function Terms() {
    return (
        <div className={classes.wrap}>
            <p className={`${classes.title}`}>TERMENI ȘI CONDIȚII</p>
            <p className={`${classes.subtitle}`}>Despre noi</p>
            <p className={`${classes.text}`}>Salut și bine ai venit pe www.bookcoffee.ro, site-ul oficial al companiei Book Coffeeshop SRL, persoană juridică, cu sediul social în Strada Sf. Ioan, Nr.  24, Brașov, CUI 41099816, înregistrat la Registrul Comerțului sub numărul J08/1669/13.05.2019, având cont bancar la: ING Bank București Centrala, RO 95INGB0000999909152606 și cod poștal 500030, prin intermediul căruia sunt oferite serviciile companiei.</p>
            <p className={`${classes.text}`}>Prin accesarea și navigarea pe site-ului www.bookcoffee.ro, se acceptă în totalitate termenii și condițiile expuse mai jos. Utilizatorii site-lui vor avea acces permanent la termenii și condițiile utilizării site-ului pentru a le putea consulta în orice moment. În cazul în care nu sunt de acord cu termenii și condițiile impuse, utilizatorii trebuie să înceteze accesarea site-ului.</p>
            <p className={`${classes.subtitle}`}>Modificări în site</p>
            <p>Termenii și condițiile pot fi schimbate în orice moment de către administratorul site-ului, noile prevederi fiind aplicabile de la momentul afișării formei revizuite pe site. Excepție fac comenzile care sunt în curs de executare, ce se vor finaliza în condițiile aplicabile la momentul acceptării comenzii.</p>
            <p>De asemenea, putem actualiza conținutul pe site, de aceea, este posibil ca acesta să nu fie tot timpul complet.</p>

        </div>
    )
}

export default Terms;
